        return (
            <Modal
                // dimmer={dimmer}
                open={this.state.open}
            onClose={this.setState({ open: false })}
            >
                <Modal.Header>Error</Modal.Header>
                <Modal.Content>fdh
                    {/* {this.state.errorMessage} */}
                </Modal.Content>
                <Modal.Actions>
                    <Button positive onClick={this.setState({ open: false })}>
                        Ok
</Button>
                </Modal.Actions>
            </Modal>
        )
    }
}

export default ErrorModal
